import * as React from 'react';
import { NavLink } from 'react-router-dom';
import './navigation.scss';

const links = [
  {
    to: '/',
    title: 'home',
  },
  {
    to: '/pagination',
    title: 'pagination',
  },
  {
    to: '/dropdown',
    title: 'dropdown',
  },
];

const Navigation: React.FC<unknown> = () => (
  <div className="navigation-wrapper">
    {links.map(({ to, title }) => (
      <NavLink
        key={title}
        className={
          ((navData) => (navData.isActive ? 'link-active' : ''), 'link')
        }
        to={to}
      >
        {title}
      </NavLink>
    ))}
  </div>
);

export { Navigation };
